<META HTTP-EQUIV="assetid" CONTENT="HP05206266"><META NAME="lcid" CONTENT="1033"><title>Can't undo this operation. Continue anyway?</title><link rel="stylesheet" type="text/css" href="office10.css"><script type="text/javascript" language="Javascript" src="ExpCollapse.js"></script><script type="text/javascript" language="JavaScript" src="inline.js"></script></head><body><h1>Can't undo this operation. Continue anyway?</h1><p>The <b class="ui">Undo</b> command isn't available for this operation because the operation is too large or there isn't enough free memory.</p><ul>
			<li>To continue the operation without the possibility of undoing it, click <b class="ui">OK</b>.</li>
			<li>To discontinue the operation, click <b class="ui">Cancel</b>.</li>
		</ul></body></html>
